import React, { Fragment, } from "react";
import Header from "./components/Layout/Header";
import Item from "./components/Item/Item";
import Cart from "./components/Cart/Cart";

function App() {
  return (
    <Fragment>
      <Cart />
      <Header />
      <main>
        <Item />
      </main>
    </Fragment>
  );
}

export default App;
